          <roiContentBullet props={bullets[0]}></roiContentBullet>
          <roiContentBullet props={bullets[1]}></roiContentBullet>
        </nav>
        <nav>
          <roiContentBullet props={bullets[2]}></roiContentBullet>
          <roiContentBullet props={bullets[3]}></roiContentBullet>
        </nav>
        
    </div>
  )
}
